import React from 'react';

export default function VisitsHeader() {
    return (
        <thead>
            <tr className='flex center'>
                <th>Visiteurs</th>
                <th>Personne rencontrée</th>
                <th>Entreprise</th>
                <th>Motif visite</th>
                <th>Entrée</th>
                <th>Sortie</th>
            </tr>
        </thead>
    );
}
